import './App.css';
import UserList from './UserList';
import AddUpateUser from './AddUpateUser';

//Using App.js to handle the components to avoid the unecessary cluster at the root index.js

function App() {
  return (
    <div className="App">
      <UserList />
      <AddUpateUser />
    </div>
  );
}

export default App;
